(126, 1, '2023-07-01 09:35:32', '2023-07-01 09:35:32', '<!-- wp:heading {\"level\":1} -->\n<h1 class=\"wp-block-heading\">Allgemeine Geschäftsbedingungen der Impact Software GmbH</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>Stand, 14.03.2019</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>1.Geltung<br></strong>Die nachfolgenden allgemeinen Geschäftsbedingungen (AGB) gelten, soweit nicht schriftlich andere Vereinbarungen getroffen wurden. Die Erteilung eines Auftrages schliesst die Anerkennung der AGB durch den Auftraggeber ein. Allgemeinen Geschäftsbedingungen unserer Vertragspartner wird widersprochen. Sie haben nur Geltung, sofern sie von der Impact Software GmbH ausdrücklich anerkannt worden sind.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>2. Retouren<br></strong>Unsere Retouren werden unter folgenden Bedienungen gehandelt:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>14 Tage nach Anlieferung beim Empfänger</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Im Originalzustand und ungeöffnet</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Unbeschädigt</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Grusskarten und andere Zusatzprodukte werden im Kundenauftrag erbracht und sind von einer Rückerstattung ausgeschlossen.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Die Kosten für einen zusätzlich in Anspruch genommene Lieferservice (Priority, Express, Wunschdatum, etc.) werden nicht rückerstattet.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Es wird eine Gebühr von CHF 10.- für die Kauf- und Rückabwicklung erhoben</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Versandkosten die auf Grund eines Widerrufs oder einer Rücksendung entstehen, werden von uns nicht erstattet oder übernommen.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Unfreie Sendungen werden abgelehnt</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>3. Lösungsangebot, Vertragsabschluss<br></strong>Lösungsangebote der Impact Software GmbH sind, sofern nicht ausdrücklich etwas anderes bestimmt wird, freibleibend. Mündliche Vereinbarungen haben nur Gültigkeit, sofern sie schriftlich bestätigt worden sind. Ein Vertrag gilt als abgeschlossen, wenn die Impact Software GmbH nach Erhalt des Auftrags dessen Annahme schriftlich bestätigt hat. Die Auftragsbestätigung istmassgebend für die Bestimmung von Umfang und Ausführung der Vertragsleistungen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>4. Preise<br></strong>In den Lösungsangebotspreisen der Impact Software GmbH sind die Mehrwertsteuer, Kosten für Transport und Versicherung sowie weitere Spesen und Barauslagen nicht enthalten. Diese werden separat in Rechnung gestellt. Pauschalpreise basieren auf den bei Vertragsschluss bekannten Grundlagen. Bei nicht voraussehbarer Änderung dieser Grundlage hat die Impact Software GmbH das Recht, Pauschalpreise nach Rücksprache mit dem Kunden anzupassen. Aufwandpreise richten sich nach dem effektiv geleisteten Aufwand bzw. dem vereinbarten Stundenansatz.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>5. Zahlungsbedingungen<br></strong>Zahlungen sind netto ohne Abzüge innerhalb von 10 Tagen nach Rechnungsstellung zu leisten, sofern nicht schriftlich etwas anderes vereinbart wurde. Wird der Zahlungstermin nicht eingehalten, schuldet der Auftraggeber ab Zeitpunkt der Fälligkeit ohne besondere Mahnung einen Verzugszins von mindestens 4% über dem dann aktuellen Hypothekarzins (p.a.). Durch die Leistung von Verzugszinsen wird die Pflicht zur vertragsmässigen Zahlung nicht aufgehoben.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>6. Verrechnung<br></strong>Andere Forderungen des Auftraggebers oder Gegenansprüche, auch wenn sie aus dem gleichen Vertrag herrühren, dürfen nur mit der schriftlichen Zustimmung von der Impact Software GmbH verrechnet werden.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>7. Lieferung und Installation<br></strong>Die Lieferfrist beginnt ab Datum des Vertragsabschlusses zu laufen. Bei verspäteter Lieferung steht dem Käufer kein Recht auf Schadenersatz, Preisminderung oder Rücktritt vom Vertrag zu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>8. Garantie<br></strong>Die Impact Software GmbH garantiert die Mängelfreiheit und Funktionsfähigkeit der von ihr verkauften bzw. installierten eigenenProdukten. Die Gewährleistungsfrist beträgt sechzig Tage ab Lieferung. Innerhalb dieser Frist werden fehlerhafte Produkte unentgeltlich ersetzt bzw. verbessert. Jede weitere Gewährleistung, insbesondere ein Anspruch auf Wandelung, Minderung oder Schadenersatz, ist ausgeschlossen.<br>Keine Garantie wird übernommen für Produkte (Hard- oder Software), welche von der Impact Software GmbH in Erfüllung ihres Auftrages von Dritten zugekauft bzw. mit dem Recht zum Gebrauch erworben worden sind. Auf Verlangen werden die Garantieansprüche von der Impact Software GmbH gegen den Dritten dem Kunden abgetreten. Sofern die Impact Software GmbH die Behebung von Mängeln an Drittprodukten vornehmen muss, werden die entstehenden Kosten dem Kunden verrechnet.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>9. Haftung<br></strong>Jede die Garantieleistung übersteigende vertragliche oder ausservertragliche Haftung, insbesondere diejenige für sogenannte Folgeschäden oder indirekte Schäden, ist gegenüber dem Auftraggeber ausgeschlossen. Der Haftungsausschluss gilt nicht für absichtlich oder grobfahrlässig zugefügte Schäden. In jedem Fall ist die Haftung auch bei grober Fahrlässigkeit auf die Höhe der Vertragssumme beschränkt.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>10. Eigentumsvorbehalt<br></strong>Gelieferte Ware bleibt bis</p>\n<!-- /wp:paragraph -->', 'AGb', '', 'publish', 'closed', 'closed', '', 'agb', '', '', '2023-07-01 09:35:32', '2023-07-01 09:35:32', '', 0, 'http://localhost/desa/?page_id=126', 0, 'page', '', 0),
